import Header from "../components/Header";

export default function Dashboard () {
    return (
        <div>
            <Header />
            <h1>Dashboard</h1>
            {user &&
                <div>
                    <img src={user.picture}></img>
                    <h3>{user.name}</h3>
                </div>
            }
        </div>

    );
}
